import CustomImage from "./CustomImage"

export default function HeroSection(){
    const images = [
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,",
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSALIz0DdU-K6w5HdCPrd3JoRxMo461qPNpFQ&usqp=CAU",
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR2bMjqID5NqCkCmj1ycrjXr4xX0srF6VGfJw&usqp=CAU",
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQYilpTFvF6SaptdDnsVkL1opdPpzCjAm9LkQ&usqp=CAU"

    ]
    return(
        <div className="section hero">
            <div className="col typography">
                <h1 className="title">What Are We About</h1>
                <p className="info">FoodiesHub is a place where you can please your soul and tummy with delicious food recipes of all cuisine. And our service is absolutely free. So start exploring now.</p>
                <button className="btn">explore now</button>

            </div>
            <div className="col gallery">
                { images.map((src, index) => (
                    <CustomImage key={index} imgSrc={src} pt={"90%"} />
                ))}
                
            </div>
        </div>
    )
}
